import * as React from 'react';
import {AppBar, Button, Menu} from "@mui/material";
import Container from '@mui/material';



function NavBar() {
  

  return (
   
<AppBar sx={{
  position :"fixed",
  top:"1.5%",
  display: "flex",
  justifyContent:"center",
  alignItems:"center",
    zIndex: "11",
    backgroundColor:"#341f97",
    width:"90vw",
    height:"6ch",
    borderRadius:"20px",
    right:"auto",
   }} id = "navbar">
    <Container maxWidth = "xl">



    </Container>

   </AppBar>
   
  );
}
export default NavBar;
